import React, { useEffect } from 'react';

export const Tile = ({tile}) => {

  useEffect(() => {
    console.log(tile);
    console.log(tile.map);
  });

  return (
    <div className="tile-container">
      {
        tile.keys.map((property, index) => {
          if (index == 0) {
            return <p className="title-title">{property}</p>
          } else {
            return <p className="title">{property}</p>;
          }
        })
      }
    </div>
  );
};
